import React, { useState } from 'react';
import { validateClient } from '../utils/validation';

const AddClientForm: React.FC<{ onAddClient: (client: any) => void }> = ({ onAddClient }) => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [email, setEmail] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [idNumber, setIdNumber] = useState('');
    const [postalCode, setPostalCode] = useState('');
    const [dateOfBirth, setDateOfBirth] = useState('');
    const [city, setCity] = useState('');
    const [isActive, setIsActive] = useState(true);
    const [error, setError] = useState('');

    const handleSubmit = (e: React.FormEvent) => {
        e.preventDefault();

        const clientData = {
            firstName,
            lastName,
            email,
            phoneNumber,
            idNumber,
            postalCode,
            dateOfBirth,
            city
        };

        const validation = validateClient(clientData);

        if (!validation.isValid) {
            setError(validation.error);
            return;
        }

        setError('');
        const newClient = { ...clientData, isActive };
        onAddClient(newClient);
        clearForm();
    };

    const clearForm = () => {
        setFirstName('');
        setLastName('');
        setEmail('');
        setPhoneNumber('');
        setIdNumber('');
        setPostalCode('');
        setDateOfBirth('');
        setCity('');
        setIsActive(true);
    };

    return (
        <form onSubmit={handleSubmit}>
            <h2>Add New Client</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <div>
                <label>First Name:</label>
                <input type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
            </div>
            <div>
                <label>Last Name:</label>
                <input type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} required />
            </div>
            <div>
                <label>Email:</label>
                <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
            </div>
            <div>
                <label>Phone Number (optional):</label>
                <input 
                    type="tel" 
                    value={phoneNumber} 
                    onChange={(e) => setPhoneNumber(e.target.value)} 
                    placeholder="+27XXXXXXXXX or 0XXXXXXXXX"
                />
            </div>
            <div>
                <label>ID Number:</label>
                <input 
                    type="text" 
                    value={idNumber} 
                    onChange={(e) => setIdNumber(e.target.value)} 
                    required 
                    maxLength={13}
                    placeholder="13-digit South African ID"
                />
            </div>
            <div>
                <label>Postal Code:</label>
                <input 
                    type="text" 
                    value={postalCode} 
                    onChange={(e) => setPostalCode(e.target.value)} 
                    required 
                    minLength={4}
                    maxLength={10}
                />
            </div>
            <div>
                <label>Date of Birth:</label>
                <input 
                    type="date" 
                    value={dateOfBirth} 
                    onChange={(e) => setDateOfBirth(e.target.value)} 
                    required 
                />
            </div>
            <div>
                <label>City:</label>
                <input type="text" value={city} onChange={(e) => setCity(e.target.value)} required />
            </div>
            <div>
                <label>
                    <input type="checkbox" checked={isActive} onChange={() => setIsActive(!isActive)} />
                    Active
                </label>
            </div>
            <button type="submit">Add Client</button>
        </form>
    );
};

export default AddClientForm;
